import React from 'react';
import {NavLink} from "react-router-dom"
function PredictionTable(props) {
    return (
        <div>
    <div className="prediction-table">
    <NavLink className="navT navt" >PSAR Trend</NavLink>
    <NavLink  className="navT"  >ADX Indicators</NavLink>
    <NavLink className="navT"   >RSI Indicators</NavLink>
    <NavLink  className="navT"  >MACD Indicators</NavLink>
    <NavLink className="navT"  >MFI Oscillators</NavLink>
    <NavLink  className="navT"  >CCI Oscillators</NavLink>
    <NavLink  className="navT"  >William %R Indicators</NavLink>
    <NavLink  className="navT"  >Bollinger Bands</NavLink>
    <NavLink  className="navT"  >Stochastic Oscillators</NavLink>
    <NavLink  className="navT navt2"  > Chimoku Cloud</NavLink>
            </div>
        </div>
    );
}

export default PredictionTable;
